                            saveSettings(prefsSectionName, prefsName, base64Encode("bad"));
                            saveSettings(prefsSectionName, prefsVersionName, strScriptVersion);
                            saveSettings(prefsSectionName, prefsLicVersion, licensingVersion);
                            checkCode(doPrompt);
